import React from "react";
import "./BSC.css";

const BSC = () => {
  return (
    <div className="bsc-page">
      <h1 className="page-title">Upper Primary (VI to VIII)</h1>
      <p className="intro-text">
        The academic year starts from June till April
        <br />
        <strong>School timing:</strong> 07.00 AM to 11.50 AM
      </p>
      <p className="intro-text">
        We at upper primary provide spirit learning surroundings where students are boosted to accomplish
        innovative ideas while building the foundational competency necessary for academic success. Our
        focus is on creative practices that promote learning at the core level. Students learn a curriculum
        that motivates the construction of innovativeness and the solving of physical world problems.
        Students are furnished to set an aim, review their learning, and take efforts. Creativity is flourished
        as students are inspired to think deeper and share their ideas.
      </p>
    </div>
  );
};

export default BSC;
